import React from "react";
import "./NavBar.css";

const NavBar = () => {
  return (
    <header className="navbar">
      <div className="navbar__logo">
        <h2>Expense Tracker</h2>
      </div>
      <nav className="navbar__items">
        <ul>
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="/new-expense">New Expense</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};
export default NavBar;
